import pig from './images/pig.png'


function Landing() {
    return (
        <div className='text-center  p-3 '>
                <img src={pig} className="figure-img img-fluid text-center  w-50 p-3 pig " alt="pig logo"></img>
                <p className='btn'>Sign up <a href='/register'>here</a></p>

        </div>
    )
}





export default Landing;
